Defendant is sentenced to the Wisconsin State Prison System for a total sentence of fifty-four (54) months on each count concurrent.   Eighteen (18) months initial confinement followed by thirty-six (36) months extended supervision.   Court finds the defendant is eligible for the Challenge Incarceration Program and the Substance Abuse Program.  Conditions of extended supervision are:
1) Assessment/treatment/counseling as deemed appropriate by the Department's assessment process;
2) Comply with any assessments ordered by the agent; 
3) Submit to random urine screens and pay for same; 
4) Submit DNA sample and pay surcharges;
5) AODA assessment and follow through counseling; 
6) Perform 100 hours of community service work; 
7) Maintain full-time employment/schooling combination; 
8) Pay restitution as follows:  $305.31 to Shopko and $5,773.08 to Mary Vater, N6893 Zephyr Road, Plymouth, WI  53073.
Court orders cash bail to be applied to the restitution for Mary Vater.   
